script: |
  super -f text -I q8600.spq | sort > q8600.out

inputs:
  - name: q8600.spq
    data: |
      SELECT ALL + col0 * + col2 FROM tab0 (FORMAT parquet) WHERE 31 * col0 NOT BETWEEN NULL AND - 37 / ( 16 ) OR NOT + col0 <> + col2;
  - name: tab0

outputs:
  - name: q8600.out
    data: |
      705
      870
      9603
